@pytest.mark.unit
class TestChunk:
    fields = ["uuid", "upload_status", "start_timestamp_ms", "end_timestamp_ms", "payload_size"]

    def test_empty_input(self):
        chunk_description = dict()
        obj = Chunk(chunk_description)
        for field in self.fields:
            assert not eval(f"obj.{field}")

